CREATE TABLE m_coop_live_room_mission_weight(
  live_id INTEGER NOT NULL,
  position INTEGER NOT NULL,
  mission_m_id INTEGER NOT NULL,
  PRIMARY KEY (live_id, position, mission_m_id),
  FOREIGN KEY (live_id) REFERENCES m_coop_live(id),
  FOREIGN KEY (mission_m_id) REFERENCES m_coop_live_room_mission(id)
);
